// import React from 'react'
import './App.css';


const App = () => {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://img.freepik.com/free-psd/engraved-black-logo-mockup_125540-223.jpg?size=338&ext=jpg"></img>
      </header>
      <nav className="nav">
        <div>
          Profile
          </div>
        <div>
          Messages
          </div>
      </nav>
      <div className="content">
        Main Content
        </div>
    </div>
  );
}

export default App;
